SELECT ?property ?hasValue ?isValueOf
WHERE {
  { <http://qu.dbpedia.org/resource/Willa> ?property ?hasValue }
  UNION
  { ?isValueOf ?property <http://qu.dbpedia.org/resource/Willa> }
}

